long int add(long int a, long int b) {
    long int sum=0;
    long int k=1;
    int c=0;
    while(a || b || c) {
        sum+=k*(c-c%BASE)/BASE;
        c=a%10+b%10;
        sum+=c%BASE*k;
        if(sum>=BASE*k)
        {
